private boolean containsArtifact(User user, IArtifact artifact) {
    if (!user.getRelatedArtifacts().isEmpty()) {
        if (user.getRelatedArtifacts().containsKey(artifact)) {
            if (user.getRelatedArtifacts().get(artifact) == 0) {
                return true;
            } else {
                return false;
            }
        } else {
            return false;
        }
    } else {
        return false;
    }
}
